import logo from './logo.svg';
import './App.css';

function App() {

  function getGreeting(user) {
    if (user) {
      return <h1>Hello, {formatName(user)}!</h1>;
    }
    return <h1>Hello, Stranger.</h1>;
  }

  function formatName(user) {
    return user.firstName + ' ' + user.lastName;
  }

  const user = {
    firstName: 'Harper',
    lastName: 'Perez'
  };

  const element = (
      <h1>
        Hello, {formatName(user)}!
      </h1>
  );
  return (
    <div className="App">

      <getGreeting />

    </div>
  );
}

export default App;
